import React, {Component} from 'react';
import ReactMap, { Layer, Feature, Popup } from 'react-mapbox-gl';


class MapBoxMapComponent extends Component {

  render(){
    const Map = ReactMap({
      accessToken: "pk.eyJ1IjoiY2Rmcml0ejciLCJhIjoiY2sydzBmenM3MGF1djNrcWR3YzRmaGQ0aCJ9.y0TZwO3PN1sYjakT02t1fQ"
    });

    return (
      <Map
        style="mapbox://styles/mapbox/streets-v9"
        containterStyle={{
          height: '100vh',
          width: '100vw'
        }}
        >
      </Map>
    )
  }
}

export default MapBoxMapComponent;
